		private static byte pieceIndex(char c) {
			switch(c) {
				case 'P': return 1;
				case 'N': return 2;				
				case 'K': return 3;
				case 'R': return 5;
				case 'B': return 6;
				case 'Q': return 7;
				case 'p': return 9;				
				case 'n': return 10;				
				case 'k': return 11;
				case 'r': return 13;
				case 'b': return 14;
				case 'q': return 15;
				default: return 0;
			}
		}

